import React, { useEffect, useState } from "react";

const Users = () => {
  let [user, setUser] = useState([]);
  useEffect(() => {
    fetch("http://localhost:4000/users")
      .then((data) => data.json())
      .then((elem) => setUser(elem));
  });

  return (
    <div>
     <table>
      <tr>
        <th>id</th>
        <th></th>
        <th></th>
        <th></th>
      </tr>
     </table>
    </div>
  );
};

export default Users;
